  true,\n\t\"url\": null,\n\t\"notes\": \"The Guide to Available Mathematical Software
  (GAMS) is a virtual repository of software for solving frequently occurring mathematical
  problems such as the linear systems of equations, differential equations and evaluation
  of special functions.  Access to the database is provided through a web interface
  in which software can be identified through a problem classification scheme or by
  name.  Public domain software modules, typically coded in Fortran or C, which are
  archived either at NIST or at the netlib repository at the University of Tennessee
  at Knoxville and Oak Ridge National Laboratory, can be downloaded through the system.
  \ This is a legacy system which is no longer actively maintained.\",\n\t\"license_title\":
